import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars } from '@fortawesome/free-solid-svg-icons';
import {Modal, Box} from '@mui/material'; 
import React from 'react';
import './Art.css';

const Art = () => {
    const artImages = [{
        photo: `url("/1.jpg")`,
        text:"first project"
    },
    {
        photo: `url("/2.jpg")`,
        text:"second project"
    },
    {
        photo: `url("/25.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/3.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/6.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/5.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/4.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/7.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/8.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/9.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/10.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/27.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/11.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/28.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/12.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/13.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/14.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/15.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/16.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/17.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/18.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/19.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/20.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/26.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/21.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/22.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/23.jpg")`,
        text: "third project"
    },
    {
        photo: `url("/24.jpg")`,
        text: "third project"
    }
    ]
    const [openModal, setOpenModal] = useState();
    const [id, setId] = useState();

    const setSrc = () => {
        console.log(id);
        var stringMe = `/${id}.jpg`;
        document.getElementById("modalImage").src = stringMe;
        console.log(stringMe);
    }

    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: '80vw',
        height: '40vw',
        bgcolor: '#FFF6D8',
        color: 'white',
        p: 4,
      };
    return (
        <div className="art">
             <div className="top-bar">
                <div className="logo"><a href='/about'><img src="/logo.png" alt='logo'/></a></div>
                <div className="grid-container">
                    <div className="grid-child"><button type="button"><a href="/about">about</a></button></div>
                    <div className="grid-child"><button type="button"><a href="/projects">projects</a></button></div>
                    <div className="grid-child"><button type="button" id="active"><a href="/art">art</a></button></div>
                    <div className="grid-child"><button type="button"><a href="/resume">resume</a></button></div>
                </div>
                <div className="dropdown">
                    <button>
                        <FontAwesomeIcon icon={faBars} className="dropbtn"/>
                    </button>
                    <div className="dropdown-content">
                        <a href="/about">about</a>
                        <a href="/projects">projects</a>
                        <a href="/art">art</a>
                        <a href="/resume">resume</a>
                    </div>
                </div>
            </div>
            <div className="bodyArt">
                <h2>some of my hobbies</h2>
                <div className="gridArt">
                    {artImages.map((e,i) => 
                        <div className="outerChild" onMouseEnter={() => {setId(i); setSrc()}} onClick={() => {setOpenModal(true)}} >
                            <div className="gridArt-child" style={{ 
                                backgroundImage: e.photo 
                            }}></div>
                        </div>
                    )}

                    <Modal
                        open={openModal === true}
                        onClose={() => setOpenModal(false)}
                        aria-labelledby="modal-modal-title"
                        aria-describedby="modal-modal-description"
                      >
                        <Box sx={style}>
                          <img id="modalImage" src='null' alt="cardigan"></img>
                        </Box>
                      </Modal>
                </div>
            </div>
        </div>   
    )
};

export default Art;
